import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Login from './comp/Login';

function App() {
  return (
    <div className="App">
       <Router>
      <Header />
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/login" element={<Login />} />
      </Routes>
    </Router>
    </div>
  );
}

export default App;
